import React from 'react';

function Tasks(){

    const arr1 = [1,2,3];
    const arr2 = ["one","two","three"];
    const arr3 = [];

    for(let i = 0; i<arr2.length; i++){
        for(let j = 0; i<arr1.length; j++){
            arr3.push(arr1[j] + " " + arr2[i]);
        }
    }

    console.log(arr3[3]);

    return(arr3);


}

